# 解法思路1:

这题本质上就像做加法一样。我们先用linkedlist来存结果，因为往链表头加一个数的操作是O(1)

`num = [1,2,0,0], k = 34`

可以当作 num的最后一位加了34。然后我们保留它的最后一位，也就是往我们的结果数组里面add一个(nums[i] + k) % 10。

然后num[i - 1]的前面一位要进位。这个要进的位就是 34/10的结果。这里是3。

然后我们一直进行这个操作直到遍历完整个数组。这里有个问题就是k本身的长度可能比num的数组长度大。所以如果k>0（说明k没加完）。我们继续把k % 10，结果加到res数组里。然后再k/10进位。

## 注意要点：
注意k可能本身的长度比num长。

这道题空间复杂度是O(1)因为只有返回的数组占了空间复杂度。算法本身没有用任何辅助的数据结构。

## 复杂度：

时间：$O(n)$

（O(k)，K是k的位数))

空间：$O(1)$

## 第一次自己写的代码：

