class Solution {
    public List<Integer> addToArrayForm(int[] num, int k) {
        LinkedList<Integer> tmp = new LinkedList<>();
        for(int i = num.length - 1; i >= 0; i--) {
            num[i] += k;
            tmp.addFirst(num[i] % 10);
            k = num[i] / 10;
        }
        while(k > 0) {
            tmp.addFirst(k % 10);
            k = k / 10;
        } 
        List<Integer> res = new ArrayList<>(tmp);
        return res;
    
    }
}
